import React from "react";
import { CopyToClipboard } from "react-copy-to-clipboard";
import {
  Button,
  TextField,
  Grid,
  Typography,
  Container,
  Paper,
} from "@mui/material";
import { Assignment, Phone, PhoneDisabled } from "@mui/icons-material";

const Options = ({ children }) => {
  return (
    <div>
      Options
      {children}
    </div>
  );
};

export default Options;
